  return (
    <div>
        <Header />
        <div  className = {styles.home}>
          <div className = {styles.box}>
            <TemplateList />
          </div>
          <div className = {styles.box}>
            <TemplateEditor />
          </div>
        </div>
    </div>
  );
};
